function Card(props)
{
return (
    <div className="card">

    <img src={props.image} className="image"></img>
    <div className="tour-details">
        <h4 className="tour-price">{props.price}</h4>
        <h4 className="tour-name">{props.name}</h4>
    </div>

    </div>
)
}

export default Card;
